var tf = require('@tensorflow/tfjs')

let model = null
const init = async () => {
	try{
		model = await tf.loadLayersModel('http://localhost:3000/modelJS/model.json')
		console.log(model.summary())
	}
	catch(e){
		console.log(e)
	}
}

init()

export default Main;
